import React, {Fragment} from "react";
import {Link} from "react-router-dom";
import {Button} from "react-flexbox-grid";

export default function BackBtn(){
    return <Fragment>
                <Link to={`/Anime`}>
                    <Button className="back_btn"><strong>Home</strong></Button>
                </Link>
            </Fragment>
}
